-- Using indo_coordinate Database
USE indo_coordinate;

-- Creating Regencies Table
CREATE TABLE regencies (
  id BIGINT NOT NULL PRIMARY KEY,
  province_id BIGINT NOT NULL,
  FOREIGN KEY (province_id) REFERENCES provinces(id) ON UPDATE CASCADE ON DELETE CASCADE,
  name VARCHAR(255) NOT NULL,
  alt_name VARCHAR(255) NOT NULL DEFAULT '',
  latitude DOUBLE NOT NULL DEFAULT 0,
  longitude DOUBLE NOT NULL DEFAULT 0
);


-- Showing Regencies Table
SELECT *
FROM regencies;

-- Exporting the table into .csv file
SELECT 'id', 'province_id', 'name', 'alt_name', 'latitude', 'longitude'
UNION
SELECT id, province_id, name, alt_name, latitude, longitude
INTO OUTFILE 'C:\\ProgramData\\MySQL\\MySQL Server 8.0\\Uploads\\regencies.csv'
FIELDS TERMINATED BY ','
LINES TERMINATED BY '\n'
FROM regencies;